import React from "react";

function Experiences (props) {
    return (
       <div>
            <div style={{display:"flex"}}
            ><h4 className='ExpNames'>{props.name}</h4>
            <h4 className='ExpYear'>{props.year}</h4>
            </div>

            <div>
                <hr/>
            </div>
       </div> 
    )
}

export default Experiences
